import Hero from './components/Hero/Hero';
import SearchForm from './components/SearchForm/SearchForm';
import List from './components/List/List';

const App = () => {
  return (
    <div>
      <div>
        <Hero />
        {SearchForm}
        <List />
      </div>
    </div>
  );
};

export default App;
